import React, { useState } from "react";

const Counter = ({ name }) => {
  const [count, setCount] = useState(0);

  const handleIncrement = () => {
    setCount(count + 1);
    console.log("count : ", count);
  };

  return (
    <div>
      <p>
        {name} : {count}
      </p>
      <button onClick={() => setCount(count - 1)}>+</button>
      <button onClick={() => setCount(count + 1)}>+</button>
    </div>
  );
};

export default Counter;
